import React, { useEffect, useState } from "react";
import Paginacao from './Paginacao';
import Navbar from './NavBar';
import Cadastro from './Cadastro';
import { BrowserRouter as Router } from 'react-router-dom';

function PaginaInicial() {

    const [usuarios, setUsuarios] = useState('')

    useEffect(()=>{
        fetch("http://localhost:8080/usuario/getAll")
        .then( res => res.json())
        .then((resultado)=>{
            setUsuarios(resultado)
        })
    })


  return (
    <div>
    {/* ---------------------------- NavBar ------------------------------- */}
    <div> 
      <nav className="relative flex flex-wrap items-center justify-between px-2 py-3 bg-cyan-500 mb-3">
        <div className="container px-4 mx-auto flex flex-wrap items-center justify-between">
          <div className="w-full relative flex justify-between lg:w-auto lg:static lg:block lg:justify-start">
            <a className="text-sm font-bold leading-relaxed inline-block mr-4 py-2 whitespace-nowrap uppercase text-white"  href="#nada" >
              API REST
            </a>
          </div>
        </div>
      </nav>
      </div>
      {/* ------------------------------- Lista e busca ------------------------------------------ */}
    
      <div className="relative max-w-xs">
                <label htmlFor="hs-table-search" className="sr-only">
                    Search
                </label>
                <input
                    type="text"
                    name="hs-table-search"
                    id="hs-table-search"
                    className="block w-full p-3 pl-16 text-sm border-gray-200 rounded-md focus:border-blue-500 focus:ring-blue-500 bg-gray-200"
                    placeholder="Search..."
                />
                <div className="absolute inset-y-0 left-0 flex items-center pl-4 pointer-events-none">
                    <svg
                        className="h-3.5 w-3.5 text-gray-400"
                        xmlns="http://www.w3.org/2000/svg"
                        width="16"
                        height="16"
                        fill="currentColor"
                        viewBox="0 0 16 16"
                    >
                        <path d="M11.742 10.344a6.5 6.5 0 1 0-1.397 1.398h-.001c.03.04.062.078.098.115l3.85 3.85a1 1 0 0 0 1.415-1.414l-3.85-3.85a1.007 1.007 0 0 0-.115-.1zM12 6.5a5.5 5.5 0 1 1-11 0 5.5 5.5 0 0 1 11 0z" />
                    </svg>
                </div>
            </div>

{/*       <Paginacao/>
    <Cadastro/> */}
    </div>
  );
}

export default PaginaInicial;
